import React from 'react';
import './Footer.css';


export default function Footer() {
  return (
    <div className='container'>
      <div className='logo'>
      <img src='logotipo.png' width='120px' height='90px'> jjjj</img>
      </div>
      <div className='center'>
        <h1>La constante de Proponer</h1>
      </div>
      <div className='box'>
      <img src='salonPlasticaMexicana-9fdd5cff.png' width='110px' height='80px'></img>
        <p>Miembro Activo del Salón de la Plástica Mexicana</p>
      </div>
    </div>
  );
}
